import React from "react";

import alunos from '../../data/alunos'

export default props => {
    const lis = alunos.map(a => {
        return (
            <li>
                {a.id} {a.nome} {a.nota}
            </li>
        )
    })

    return (
        <div>
            <ul>
                <li>{alunos} - 9.7</li>
                <li>Carlos - 7.7</li>
                <li>Ana - 5.3</li>
            </ul>
        </div>
    )
}
